script: |
  super -f text -I q1556.spq | sort > q1556.out

inputs:
  - name: q1556.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) WHERE NOT - - col1 * col1 * col1 BETWEEN + - col2 AND + col0 / 2 + - col1 / - col1;
  - name: tab0

outputs:
  - name: q1556.out
    data: |
      15	81	47
      87	21	10
